import React from "react";
// Import Component MUI
import {
  Box,
  Button,
  Card,
  CardContent,
  CardMedia,
  Container,
  Grid,
  IconButton,
  InputAdornment,
  TextField,
  Typography,
  // InputBase,
} from "@mui/material";
import { CardActionArea } from "@mui/material";
// Import Icon
import SearchIcon from "@mui/icons-material/Search";
import "boxicons";
// Import Images
import images from "../assets/images/noimage.jpg";

export default function ListSertifikat() {
  return (
    <>
      <Container>
        <Box sx={{ mt: 10 }}>
          {/* Card */}
          <Grid
            container
            direction={{ xs: "column", md: "row", xl: "row" }}
            justifyContent="center"
            alignItems="center"
          >
            {/* Card 1 */}
            <Grid item xs={12} md={6} xl={6}>
              <Card
                sx={{
                  width: {
                    lg: "90%",
                    md: "90%",
                    xs: "100%",
                  },
                  height: {
                    lg: 318,
                    md: 318,
                    xs: 310,
                  },
                  mt: 2,

                  border: "#0000008A solid",
                }}
              >
                <CardActionArea>
                  {/* Image */}
                  <CardMedia
                    component="img"
                    height="220"
                    image={images}
                    alt="sertifikat"
                  />
                  <CardContent>
                    {/* Title */}
                    <Typography
                      sx={{
                        mt: -1.5,
                        mb: 0,
                        fontWeight: "bold",
                        fontSize: {
                          lg: "19px",
                          md: "19px",
                          xs: "16px",
                        },
                      }}
                    >
                      KEJUARAAN WAKODAI MONAS CUP 2016
                    </Typography>
                    {/* Description */}
                    <Typography
                      sx={{
                        mb: 1,
                        fontSize: {
                          lg: "18px",
                          md: "18px",
                          xs: "16px",
                        },
                      }}
                    >
                      Juara 2 - Kumite Perorangan Putri -48 Kg
                    </Typography>
                    {/* Date */}
                    <Typography
                      sx={{
                        fontSize: {
                          lg: "15px",
                          md: "15px",
                          xs: "14px",
                        },
                      }}
                    >
                      26 Juli 2016
                    </Typography>
                  </CardContent>
                </CardActionArea>
              </Card>
            </Grid>
          </Grid>
          {/* Button */}
          <Grid justifyContent="right">
            <Grid item align="right">
              <Button
                variant="contained"
                color="warning"
                sx={{
                  mt: 5,
                  mb: 3,
                  mr: {
                    lg: 7,
                  },
                  width: "50",
                  height: "50",
                  fontSize: 20,
                }}
              >
                +
              </Button>
            </Grid>
          </Grid>
        </Box>
      </Container>
    </>
  );
}
